import React from 'react'

let count = 0

const Menu = () => {

    const list = menu.map(item => {
        <li key={count++}>
            item.home.title
        </li>
    })

  return (
    <div>
      <ul>
        {list}
      </ul>
    </div>
  )
}

export default Menu

const menu = [
    {
        home: {
            title: 'Home', 
            link: '#',
            dropdown: false
        }
    },
    {
        about: {
            title: 'About', 
            link: '#',
            dropdown: false
        }
    },
    {
        pricing: {
            title: 'Pricing', 
            link: '#',
            dropdown: true,
            product: [
                {shoe: 'Shoes', link: '#'},
                {watch: 'Watches', link: '#'},
                {tuxedo: 'Tuxedos', link: '#'},
                {ring: 'Rings', link: '#'},
            ]
        }
    },
    {
        contact: {
            title: 'Contact', 
            link: '#',
            dropdown: false
        }
    }

]
